import React from 'react'

const Navbar = () => {
    return (
      <nav class="navbar navbar-expand-lg navbar-dark bg-dark nav" style="background-color: #24292f !important;">
      <div class="container-fluid" style="padding: 12px 24px;"><a class="navbar-brand" href="#"> <img src="https://icon-library.com/images/github-icon-white/github-icon-white-6.jpg" style="width: 35px;" /></a>
          <div class="collapse navbar-collapse" id="navbarNavAltMarkup">
              <div class="navbar-nav"><input class="form-control py-2 navSearch" id="example-search-input" type="text" placeholder="Search or jump to..." /><a class="nav-link" href="#" style="color:white;">Pulls</a><a class="nav-link" href="#" style="color:white;">Issues </a><a class="nav-link" href="#" style="color:white;">Marketplace</a><a class="nav-link" href="#" style="color:white;">Explore</a></div>
          </div>
      </div>
  </nav>
    )
}

export default Navbar
